import documents_generation
helper_dict={}
def read_file(document_path):
    with open(document_path,encoding='UTF-8') as file:
        # doc = file.read()


        for line in file:
            number=int(line.split(",")[0])
            size=float(line.split(",")[1].split("\n")[0])
            helper_dict[number]=size

    return helper_dict

def generate_dict():
    new_dict={}
    min_max={}
    for i in range(8):
        new_dict[i]=[]
    generated=documents_generation.getDict()
    g = documents_generation.getAllLists()

    indx=0
    for lst in g:
        if type(lst[0])!=list:

            dct={}
            for element in lst:
                if helper_dict[element] not in dct:
                    dct[helper_dict[element]] = [element]
                else:
                    dct[helper_dict[element]] += [element]

            res = []
            sorted_dct=sorted(dct)
            for key in sorted_dct:
                current_lst=[(x, helper_dict[x]) for x in dct[key]]
                current_lst.sort(key=lambda x:x[1])
                res.append(current_lst)
            #new_dict[indx]=[(x,helper_dict[x]) for x in lst]
            new_dict[indx]=res
            min_max[indx]=(sorted_dct[0],sorted_dct[-1])
            #min_max[indx]=(new_dict[indx][0][1],new_dict[indx][-1][1])
        else:
            minlst=[]
            maxlst=[]
            for smalllst in lst:

                dct = {}
                for element in smalllst:
                    if helper_dict[element] not in dct:
                        dct[helper_dict[element]] = [element]
                    else:
                        dct[helper_dict[element]] += [element]

                res = []
                sorted_dct = sorted(dct)
                for key in sorted_dct:
                    current_lst = [(x, helper_dict[x]) for x in dct[key]]
                    current_lst.sort(key=lambda x: x[1])
                    res.append(current_lst)
                # new_dict[indx]=[(x,helper_dict[x]) for x in lst]
                new_dict[indx].append(res)
                minlst.append(sorted_dct[0])
                maxlst.append(sorted_dct[-1])
                #min_max[indx] = (sorted_dct[0], sorted_dct[-1])

                #helperlst=[(x,helper_dict[x]) for x in smalllst]
                #helperlst.sort(key=lambda x: x[1])
                #minlst.append(helperlst[0][1])
                #maxlst.append(helperlst[-1][1])
                #new_dict[indx].append(helperlst)
            min_max[indx] = (min(minlst),max(maxlst))
        indx += 1
    return new_dict,min_max
